var app=angular.module("app");app.filter("fixlength",function(){return function(c,a){var b=parseInt(c,10);a=parseInt(a,10);if(isNaN(b)||isNaN(a)){return c}b=""+b;while(b.length<a){b="0"+b}return b}});app.filter("fixTime",function(){return function(b){var e=Math.floor(b/1000);var f=Math.floor(e/86400);var a=Math.floor((e%86400)/3600);var c=Math.floor(((e%86400)%3600)/60);var d="";if(f>0){d+=(f>1)?(f+" days "):(f+" day ")}if(a>0){d+=(a>1)?(a+" hours "):(a+" hour ")}if(c>=0){d+=(c>1)||(c==0)?(c+" minutes "):(c+" minute ")}if(d==""){d="?"}return d}});